    render() {

        return (

            <BrowserRouter>

                {/*Configurar rutas y paginas*/}

                <Switch>
                    <Route path= "/LoginUsuario" component= {LoginUsuario} />
                    <Route path= "/LoginUsuario" component= {LoginUsuario} />
                    <Route path= "/MiComponente" component= {MiComponente} />

